import React, { useState } from 'react'
import Header from './Components/Header';
import './Cart.css'
import Products from './Components/Products';
const CartApp = () => {
    let [product,setProduct]=useState([
        {
            url:'https://n1.sdlcdn.com/imgs/g/s/v/Boltt-Xfit-Running-Shoes-Black-SDL789843251-6-4230e.jpg',
            name:"Addidas shoes",
            category:"mens shoe",
            prize:1900
        },
        {
            url:'https://th.bing.com/th/id/OIP.5EZRHGR0LgL2IWcQ511TkQHaF5?pid=ImgDet&rs=1',
            name:"hp laptop",
            category:"ssd octacore",
            prize:40000
        }
        
    ])
  return (
    <div> 
       <Header/>
       <Products products={product}/>
    </div>
  )
}

export default CartApp
